import React from 'react';
import logo from './logo512.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <p>
          COINFLIP
        </p>

      </header>
    </div>
  );
}

export default App;
